import React, { useEffect, useState } from 'react';
import ListMenu from './list_menu/list_menu';
import './navbar.scss';
import SearchBar from './search_bar/search_bar';
import movie_logo from '../../Assets/UI Icons/video-camera.svg'
import { Link } from 'react-router-dom';
import LoginModal from '../login/login_modal';

function NavBar() {
    const [visibile, setVisibile] = useState('hidden');

    useEffect(() => {
        console.log("working.");

    }, [visibile])

    return (
        <nav className="navigation-bar">
            <div id="navigation_content">
                <div id="logo_container">
                    <Link to="/"> <img id="logo" className="filter-white" alt="logo" src={movie_logo}></img></Link>
                </div>
                <SearchBar />
                {/* style={{ visibility: this.state.visibile ? 'visible' : 'hidden' }} */}
                <button onClick={setVisibile(true)} id="sign_in_button">Sign In</button>
                {visibile ? <LoginModal /> : null}
                <ListMenu />
            </div>
        </nav>
    );
}

export default NavBar;
